  {
    var layer = [];

    for (var i = 0; i < number_data.length; i++)
      {
        var num = new Num;
        num.height = number_data[i][0];
        num.width = number_data[i][1];
	num.number = number_data[i][2];
	num.data = number_data[i][3];

        layer.push(num);
      }

    return layer;
  }

NumberDB.prototype.guess_letter =  function()
  {
    var highest = 0;
    for (var i = 0; i < this.DB.length; i++)
      {
        if (this.DB[i].score > this.DB[highest].score)
            highest = i;
      }

    return this.DB[highest].number;
  }

