function decode1(img)
{
   var canvas = document.createElement('canvas');
   canvas.width = 30;
   canvas.height = 44;  

   var ctx = canvas.getContext('2d');

   // Draw image on canvas to get its pixel data
   ctx.drawImage(img, 0, 0);

   // Get image pixels
   var imageData = ctx.getImageData(0, 0, canvas.width, canvas.height);
   var pixels = imageData.data;

   //cleanup image
   for (var i = 4, il = pixels.length - 8; i < il; i += 4) 
   {
    // Apply noise pixel with Multiply blending mode for each color channel
    if (pixels[i] >= 170 && pixels[i + 1] >= 170 &&  pixels[i + 2] >= 170)
    {	
		pixels[i] = 255 ;
		pixels[i + 1] = 255;  
		pixels[i + 2] = 255;
    }else
    {
	pixels[i] = 0 ;
	pixels[i + 1] = 0;  
	pixels[i + 2] = 0;

    }

	
   }
   //remove extra dots
    for (var i = 4, il = pixels.length - 8; i < il; i += 4) 
   {
    // Apply noise pixel with Multiply blending mode for each color channel
    if (pixels[i-4] == 0 && pixels[i] == 255 &&  pixels[i + 4] == 0)
	{	
		pixels[i] = 255 ;
		pixels[i + 1] = 255;  
		pixels[i + 2] = 255;
	}
	
   } 
  //remove more extra dots
  var i,b,a;	
  for (var y=1;y<=40;y++)	 
   {
	for (var x=2;x<=30;x++)	
	{
		        i=coord_to_index2(x,y);
			b=coord_to_index2(x-1,y);
			a=coord_to_index2(x+1,y);

			if (pixels[b] == 255 && pixels[i] == 0 && pixels[a] == 255)
			{
				pixels[i]=255;
				pixels[i+1]=255;
				pixels[i+2]=255;
			}		

	}
   }
	
//separate number data
var steps,cnt,st,md;
st=0;
md=0;
steps=1;
for (var x=2;x<=30;x++)
{
  	cnt = 0;
	for (var y=0;y<=43;y++)	 
   	{
		i=coord_to_index2(x,y);
		if (pixels[i] == 0) 	
		{
			cnt++;
		}
	}
	if (steps==1)
	{
		if (cnt>= 5)
		{
		    st=x;	
		    steps=2;		
		}

	}else if (steps==2)
	{
		if (cnt<=0 && x >= st +10 || x >= st + 20)
		{
			md=x;
			steps=3;
		}
	
	}
}

if (md==0)
{
   md=30;
}

//first number ********************************
var sh,sl;
sh=0;
sl=0;
steps=1;
for (var y=2;y<=43;y++)	 
{
	cnt=0;
	for (var x=st;x<=md;x++)
	{
  	 	i=coord_to_index2(x,y);
		if (pixels[i] == 0) 	
		{
			cnt++;
		}
	}
	if (steps==1)
	{
		if (cnt>= 3)
		{
		    sh=y;	
		    steps=2;		
		}

	}else if (steps==2)
	{
		if (cnt<=2 && y >= sh + 25)
		{
			sl=y;
			steps=3;
		}
	
	}

}
if (sl==0)
{
    sl=40;
}
 

//first letter block
var block1 = new BLOCK();
block1.height = sl-sh;
block1.width = md-st;

var temp,tmp;

for (var y=sh;y<=sl;y++)	 
{
	temp='';
	for (var x=st;x<=md;x++)
	{
  	 	i=coord_to_index2(x,y);
		if (pixels[i] == 0) 	
		{
			temp=temp + '1';
		}else
		{
			temp=temp + '0';
		}
	}
	block1.data.push(temp);
	//tmp = tmp + temp + '\n';	
}
	

	var numDB=Create_DB();


	//find match first block
	numDB.check_block(block1);
	var guess = numDB.guess_letter();
	
	
	//ctx.putImageData(imageData, 0, 0);
	//img.parentNode.appendChild(canvas);
   return guess;
}

function coord_to_index2(x, y)
  {
    return x*4+y*4*30;
  }